import React from "react"

export default function RegisterPage() {
    return (
        <div className="register-rect">
            <div className="register-title">Register</div>

            <input className="usernameReg-field" type="text" name="username" placeholder="Username" required/>
            <input className="registerReg-field" type="password" name="password" placeholder="Password" required/>
        </div>
    )
}
